import React from 'react'
import styled from 'styled-components'
import Card from '../components/Card'

const Container = styled.div`
   display: flex;
   justify-content: space-between;
   
`;

const Home = () => {
  return (
    <div>
        <Card/>
        <Card/>
        <Card/>
        <Card/>
    </div>
  )
}

export default Home
